import React, { Component } from "react";
import { AppBar, Toolbar, Typography } from "@material-ui/core";
import AccountBalanceIcon from '@material-ui/icons/AccountBalance';import { makeStyles } from "@material-ui/core/styles";

const useStyles = makeStyles({
  typographyStyles: {
    flex: 1,
    fontFamily: "cursive",
    fontSize: 30
  },
});

const NavBar = () => {
  const classes = useStyles();
  return (
    <AppBar position="static">
      <Toolbar>
        <Typography className={classes.typographyStyles}>EasyInvest</Typography>
        <Acc />
      </Toolbar>
    </AppBar>
  );
};

export default NavBar;
